function Table({ data }) {
    const renderedRows = data.map((fruit) => {
        return(
            <tr key={fruit.name}>
                <td className="p-3">{fruit.name}</td>
                <td className="p-3">{fruit.color}</td>
                <td>{fruit.score}</td>
            </tr>
        );
    });

    return (
    <table>
        <thead>
            <tr>
                <th>Fruit</th>
                <th>Color</th>
                <th>Score</th>
            </tr>
        </thead>
        <tbody>
            { renderedRows }
        </tbody>
    </table>
    );
}

export default Table;
